import { types }  from 'mobx-state-tree';

 const AppType = types.model('AppType', {
     id: types.identifier,
     icon: types.string,
     name: types.string,
 })


 const Apple = AppType.create({
     id: '1'
 })

const CalculationStore = types.model('CalculationStore', {
    appType: types.maybe(types.array(AppType)),
    active: types.safeReference(AppType)
})

export default CalculationStore;
